import { Outlet } from 'react-router-dom'
import Fede from '../../assets/imagenes/fede.jpeg'
import './index.scss'

const Home = () => {
    return (
        <div className='Container Home-Page'>
            <img src={Fede} alt='Developer'/>
            
            <div className='Text-Zone'>
                <h1>
                    <span>
                        Fede Moya 
                    </span><br/>
                    Frontend Developer/ JavaScript &amp; React
                </h1>
            </div>

            <Outlet/>
        </div>
    );
}

export default Home;
